import React, {useState, useEffect, Component} from 'react';
import axios from './axios';
import './Row.css';
import App from './login.component';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import MovieDescription from './MovieDescription';


const base_url = "https://image.tmdb.org/t/p/original/";

var result;
function test(id){
   result = id;

   //console.log(result);
   var email = localStorage.getItem("email");         //retrieve the email from local storage
   var password = localStorage.getItem("password");   //retrieve the password from local storage
   var movID=id;
   console.log(email,password,movID);



   fetch("http://localhost:5000/login",{
    method: "POST",
    crossDomain: true,
    headers:{
      "Content-Type": "application/json",
      Accept: "application/json",
      "Access-Control-Allow-Origin": "*"
    },
    body: JSON.stringify({
      email,
      password,
      movID,
    }),
  }).then((res)=> res.json())
  .then((data)=>{
    console.log(data, "userRegister");
  })



};

function Description(id) {

    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
        <Modal show={true} onHide={handleClose}>
            <Modal.Header closeButton>
                <Modal.Title>Modal heading</Modal.Title>
            </Modal.Header>
            <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleClose}>
                    Close
                </Button>
                <Button variant="primary" onClick={handleClose}>
                    Save Changes
                </Button>
            </Modal.Footer>
        </Modal>
    );
}


function Row({title, fetchUrl, isLargeRow}){
    const[movies, setMovies] = useState([]);

    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);


    const [modalIsOpen, setModalIsOpen] = useState(false);

    const setModalIsOpenToTrue =()=>{
        setModalIsOpen(true)
    }

    const setModalIsOpenToFalse =()=>{
        setModalIsOpen(false)
    }

    useEffect(()=>{

        async function fetchData(){
            const request = await axios.get(fetchUrl);
            console.log(request.data.results);
           // console.log('pizza testing');
            setMovies(request.data.results);
            return request;
        }
        fetchData();
    },[fetchUrl]);
//console.log('hello');

    console.log(movies);
   
    return (
        <div className="row">
            <div className = "category-header">
            <h2>{title}</h2>
            </div>
            
            <div className="row__posters">
                {movies.map((movie,index)=>(
                    <><img className={`row__poster  ${isLargeRow && "row__posterLarge"}`}
                        key={movie.id}
                        src={`${base_url}${isLargeRow ? movie.poster_path : movie.backdrop_path}`}
                        alt={movie.name}
                        //onClick = {() => test(movie.id)}

                        //onClick = {() => Description(movie)}

                        //onClick  = {showModal ? <MovieDescription setShowModal={setShowModal} /> : null}


                           onClick={handleShow}


                        /*
                        onClick = {() => {
                         props.movieDescription(movie.id);
                         window.scrollTo({ top: 0, behavior: "smooth" });


                     }}

                         */
                        >
                        
                        </img>


                        <Modal show={show} onHide={handleClose}>
                            <Modal.Header closeButton>
                                <Modal.Title>Modal heading</Modal.Title>
                            </Modal.Header>
                            {movie.id}
                            <Modal.Footer>
                                <Button variant="secondary" onClick={handleClose}>
                                    Close
                                </Button>
                                <Button variant="danger" onClick={handleClose}>
                                    Dislike
                                </Button>
                                <Button variant="info" onClick={handleClose}>
                                    Like
                                </Button>
                            </Modal.Footer>
                        </Modal>



                        </>




                        
                ))}




            </div>
        </div>
        
    )
    
}
export default Row

